import axios from 'axios'
import Issues from './Issues'

export const addIssue = async (issueTitle, issueDescription, issueLabels) => {
  const url = 'https://issue-tracker-spring-boot.herokuapp.com/issue'
  const issue = {
    title: issueTitle,
    description: issueDescription,
    labels: [{ labelName: 'deneme label' }]
  }

  const response = await axios.post(url, issue)



  return response
}
